script: |
  super -f text -I q1617.spq | sort > q1617.out

inputs:
  - name: q1617.spq
    data: |
      SELECT - col0 FROM tab2 (FORMAT parquet) WHERE NULL BETWEEN - col1 - col0 * 92 * - CAST ( NULL AS INTEGER ) * + - CAST ( + - ( + 45 ) AS INTEGER ) * col2 * + col0 AND NULL;
  - name: tab2

outputs:
  - name: q1617.out
    data: |
